@EU_Commission 1. To facilitate free movement in a non-discriminatory way YOU DON'T NEED A CERTIFICATE !!!

2. "been vaccinated against COVID-19": still not proven it prevents getting/passing the virus

3. "received a negative test result or": could be positive the next day

@EU_Commission What about UK /other countries vaccination? 

Will the regulations and implementation be compatible with having a certificate from these countries?

🇬🇧 🇮🇱 🇨🇱 🇺🇸 are well ahead in vaccination

@EU_Commission @VeraJourova @dreynders @EU_Justice @DigitalEU @ChristianWigand @jb_bax EMA words:
"The impact of vaccination [..] on the spread of the SARS-CoV-2 virus in the community is not yet known. It is not yet known how much vaccinated people may still be able to carry and spread the virus."
Test everyone, including vaccinated people, without discrimination.

@EU_Commission Article 13
1. Everyone has the right to freedom of movement and residence within the borders of each state.
2. Everyone has the right to leave any country, including his own, and to return to his country.

@EU_Commission @EMA_News "It is not yet known how much vaccinated people may still be able to carry and spread the virus".
A vaccination certificate doesn't guarantee vaccinated people can't spread coronavirus.
Don't create discrimination unless science proves they don't.

@EU_Commission Facilitate means actually hinder, free means restricted, non-discriminatory means discriminatory.
And for how long will we need it anyways?
Cause I am almost cerain, that you intend to stick to this control tool FOREVER MORE.

@EU_Commission DISCRIMINATION!

Yellow star time all over again

People of Europe, resist these bastards while you still can
